INSERT INTO `badges` VALUES (41,'form-inputs','<INPUT> tags','',1000,'At some point you need to deal with inputs, they are the main way to interact with a user. If you know them well you will sabe a lot of time in validations and client-server communication.','oscarr','2017-08-10 15:55:33','2017-09-07 21:31:59'),(50,'sass-master','Sass Master ','',1000,'CSS has no change in many years, SASS is CSS evolved, do a lot more with less code! The legends says that it will become the new CSS syntax eventually.','oscarr','2017-08-10 15:55:33','2017-09-07 21:31:59'),(51,'fully-committed','Fully Committed','',100,'There is no information about the badge','','2017-08-10 15:55:33','2017-08-10 18:36:06'),(52,'git-brancher','GIT Brancher','',100,'There is no information about the badge','','2017-08-10 15:55:33','2017-08-10 18:36:06'),(54,'abstract-configer','Abstract Configer','',100,'Configurations files are the best practice to make your app portable and work with several enviroments. Learn how to use them and create your own config/env/yaml files.','','2017-08-10 15:55:33','2017-08-10 18:36:06'),(55,'package-composer','Package Composer','',100,'Use composer and npm to import others people code','','2017-08-10 15:55:33','2017-08-10 18:36:06'),(56,'example-finder','Example Finder','',100,'What a better way to move forward than copying from someone else? In coding that is not called cheating, si called being smart!','','2017-08-10 15:55:33','2017-08-10 18:36:06'),(57,'docu-lover','Documentation Lover','',100,'Everylanguage has a different documentation format, some are more difficult than other but understanding their websites and documentation will make your life a lot easier.','','2017-08-10 15:55:33','2017-08-10 18:36:06'),(60,'transaction-master','Transaction Master','',100,'( rollback, refresh, etc)','','2017-08-10 15:55:33','2017-08-10 18:36:06'),(61,'seeder','Use of seeders','',100,'Seeders are the only wat to test your app with data similar to the real world.','','2017-08-10 15:55:33','2017-08-10 18:36:06'),(63,'client-vs-server','Client vs Server','',100,'Web development relys on the client-server architecture. Not knowing it is like a physicist that does not know math!','','2017-08-10 15:55:33','2017-08-10 18:36:06'),(64,'http-requester','HTTP Requester ','',100,'(get, post, put, delete, content-type, form-params)','','2017-08-10 15:55:33','2017-08-10 18:36:06'),(65,'speak-json','Speak in JSON ','',100,'(encoding, decoding)','','2017-08-10 15:55:33','2017-08-10 18:36:06'),(67,'control-freak','Control Freak ','',100,'(divide your application actions into controllers)','','2017-08-10 15:55:33','2017-08-10 18:36:06'),(68,'model-master','Model Master ','',100,'(use ORM\'s for all your data operations)','','2017-08-10 15:55:33','2017-08-10 18:36:06'),(69,'migrator','Migrator ','',100,'(create, drop and alter tables)','','2017-08-10 15:55:33','2017-08-10 18:36:06'),(72,'concatenator','Concatenator ','',100,'generate html strings document.write, generate html strings for the innerHTML, (string concat to generate JS, CSS, HTML)','','2017-08-10 15:55:33','2017-08-10 18:36:06'),(74,'window-lover','Window lover ','',100,'( frame events: on load, resize, etc.)','','2017-08-10 15:55:33','2017-08-10 18:36:06'),(75,'mouse-god','Mouse God ','',100,'(mouse events, click, hover)','','2017-08-10 15:55:33','2017-08-10 18:36:06'),(76,'keyboard-listener','Keyboard Listener','',100,'Use the (keypress, pressing enter, etc.)','','2017-08-10 15:55:33','2017-08-10 18:36:06'),(77,'request-listener','Request Listener','',100,'(on load, success, error, etc.)','','2017-08-10 15:55:33','2017-08-10 18:36:06'),(78,'storage-master','Storage Master ','',100,'variables, global vs local, data-types, etc.','','2017-08-10 15:55:33','2017-08-10 18:36:06'),(141,'ide-autocomplete-oscar',' CSS Master CREATED','../public/img/badge/rand/chevron-19.png',0,'wululu','css, html','2017-08-18 22:28:49','2017-08-18 22:28:49'),(147,'identator','Identatior for oscar','../public/img/badge/rand/chevron-16.png',100,'wululu','css, html','2017-08-31 22:33:03','2017-08-31 22:33:03'),(148,'tag-master','The god of tags!','../public/img/badge/rand/chevron-14.png',100,'wululu','css, html','2017-09-06 07:49:28','2017-09-06 07:49:28'),(149,'path-master','The god of paths!!','../public/img/badge/rand/chevron-6.png',100,'wululu','css, html','2017-09-06 07:49:49','2017-09-06 07:49:49'),(150,'be-dry','DRY Master','../public/img/badge/rand/chevron-21.png',100,'wululu','css, html','2017-09-06 07:50:19','2017-09-06 07:50:19'),(151,'abc','Always be closing','../public/img/badge/rand/chevron-10.png',100,'wululu','css, html','2017-09-06 07:50:35','2017-09-06 07:50:35'),(152,'full-stack-web','clean_coding','../public/img/badge/rand/chevron-15.png',0,'100','IDEs','2017-09-07 15:36:27','2017-09-07 15:36:27');
